                    return TryGet<int?>.Succeed((int)PlacedCreature_FieldIndex.Owner);
                case 0x4B4E5258: // XRNK
                    frame.Position += Mutagen.Bethesda.Constants.SUBRECORD_LENGTH;
                    try
